import React, { Component } from 'react';
import './App.css';
import Flexbox from 'flexbox-react'

class Box extends Component {

  render(){
    let { value} = this.props
    return (
      <div>
        <div>
          {value}
        </div>
      </div>
    )
  }
}

export default Box;
